import{_ as o,o as c,c as l,J as a,w as n,m as t,a as r,aa as s,E as e}from"./chunks/framework.DJCjJe2w.js";const x=JSON.parse('{"title":"OpenAI 推出超神 ChatGPT 注册攻略来了","description":"","frontmatter":{"createTime":"2022/12/09","tag":"工具,ChatGPT"},"headers":[],"relativePath":"tool/chartGpt/index.md","filePath":"tool/chartGpt/index.md","lastUpdated":1670580667000}'),m={name:"tool/chartGpt/index.md"},h=t("h1",{id:"openai-推出超神-chatgpt-注册攻略来了",tabindex:"-1"},[r("OpenAI 推出超神 ChatGPT 注册攻略来了 "),t("a",{class:"header-anchor",href:"#openai-推出超神-chatgpt-注册攻略来了","aria-label":'Permalink to "OpenAI 推出超神 ChatGPT 注册攻略来了"'},"​")],-1),u=s('<p>前几天，OpenAI 推出超神 ChatGPT，非常火爆。但是呢，因为不可抗力原因，大部分人无法体验到。这里我分享一下注册的攻略。</p><h3 id="准备" tabindex="-1">准备 <a class="header-anchor" href="#准备" aria-label="Permalink to &quot;准备&quot;">​</a></h3><ul><li>首先能能访问 Google（前置条件，不能明确说，懂得都懂）</li><li>你得有一个国外手机号，GV 号肯定不行。 <ul><li>如果你没有国外手机号，推荐sms-activate.org</li></ul></li></ul><h3 id="注册短信平台并充值" tabindex="-1">注册短信平台并充值 <a class="header-anchor" href="#注册短信平台并充值" aria-label="Permalink to &quot;注册短信平台并充值&quot;">​</a></h3><ul><li>先行注册sms-activate.org</li><li>注册好之后进行对应的充值</li></ul><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/8acaf6d767714b1d82122cd3206f4ba7~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"> 接码费用一次为 10.5 卢布，大约1.2 人民币。因为充值默认为美元，可以选择充值 1 美元进去，</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/5c507b1564d1442d8dfab0ebc8d481e1~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><h3 id="注册openai账号" tabindex="-1">注册OpenAI账号 <a class="header-anchor" href="#注册openai账号" aria-label="Permalink to &quot;注册OpenAI账号&quot;">​</a></h3><ul><li>打开<a href="https://link.juejin.cn/?target=https%3A%2F%2Fbeta.openai.com%2Fsignup" title="https://beta.openai.com/signup" target="_blank" rel="noreferrer">beta.openai.com/signup</a> 页面进行相应的注册。 <ul><li>这里同样需要你能访问Google且 ip 不是香港，最好是美国、新加坡等等，不然会提示不能在当前国家服务。</li></ul></li><li>注册成功进入下面填写手机号的页面 <ul><li>下面记得切换下国家区号，这里的区号默认是你代理的。</li></ul></li></ul><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/d50d22c04df0430aa0b2afca70a55beb~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><h3 id="准备接码" tabindex="-1">准备接码 <a class="header-anchor" href="#准备接码" aria-label="Permalink to &quot;准备接码&quot;">​</a></h3><blockquote><p>这里需要注意下的就是，目前好像就只有巴西和印度支持了，之前我选的印尼，是可以收到码的。</p></blockquote><p><img src="https://p9-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/79235be8d7104175a6dda1cc63f46937~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/c2e4434858ab4cbaaa9e1d8249305547~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><ul><li>然后再刚刚填写手机号码的页面填入申请的手机号</li></ul><h3 id="开始使用chatgpt" tabindex="-1">开始使用ChatGPT <a class="header-anchor" href="#开始使用chatgpt" aria-label="Permalink to &quot;开始使用ChatGPT&quot;">​</a></h3><p>注册完后，我们去ChatGPT网站去登陆。<a href="https://link.juejin.cn/?target=https%3A%2F%2Fchat.openai.com%2Fauth%2Flogin" title="https://chat.openai.com/auth/login" target="_blank" rel="noreferrer">chat.openai.com/auth/login</a></p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/3e474b55d15d4b8ea3c56e7deb5ce8f9~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><p><img src="https://p9-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/bf36cc1afc9b45539f543211739c9f83~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="image.png"></p><h4 id="_12-月-6-日更新" tabindex="-1">12 月 6 日更新 <a class="header-anchor" href="#_12-月-6-日更新" aria-label="Permalink to &quot;12 月 6 日更新&quot;">​</a></h4><ul><li>如果你的页面出现下面提示，说明你代理不行~~</li></ul><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/bc290c2a7abf4c9faee9a392819d16e4~tplv-k3u1fbpfcp-zoom-in-crop-mark:4536:0:0:0.image?" alt="img_v2_36533eb4-fa66-40bb-b165-ad8b6d401d2g.jpg"></p><ul><li>接不到码，可以在那个有效期内退回换个号试试。 <ul><li>有人直接把发的电话输入框里，没去掉区号也可以收到</li></ul></li><li>这个接码网站很全面，我演示充值是 1 美元，你也可以冲一个 0.18美元</li><li>目前完全支持的是印度+巴西。你也可以选择其他国家的 any+other 选择合适的费用即可。</li></ul><p>本文转自 <a href="https://juejin.cn/post/7173447848292253704" target="_blank" rel="noreferrer">https://juejin.cn/post/7173447848292253704</a>，如有侵权，请联系删除。</p>',24);function b(f,d,g,k,_,j){const i=e("ArticleMetadata"),p=e("ClientOnly");return c(),l("div",null,[h,a(p,null,{default:n(()=>[a(i)]),_:1}),u])}const T=o(m,[["render",b]]);export{x as __pageData,T as default};
